if(window.AOS!==undefined){AOS.init({offset:100,duration:1e3,disable:()=>window.matchMedia("(max-width: 990px)").matches,once:true,delay:100})}const dataMap=document.querySelectorAll("[data-map='true']");const observer=new IntersectionObserver(entries=>{entries.forEach(entry=>{if(!entry.isIntersecting)return;const mapLocation=document.getElementById("map-location");console.log(mapLocation);if(mapLocation){let $coordinates=[51.58942104546394,19.1482133204735];var map=L.map("map-location").setView($coordinates,13);L.tileLayer("https://tile.openstreetmap.org/{z}/{x}/{y}.png",{maxZoom:22}).addTo(map);var myIcon=L.icon({iconUrl:"../images/reusable/map-icon.png",iconSize:[56,56],iconAnchor:[43,54]});var marker=L.marker($coordinates,{icon:myIcon}).addTo(map)}observer.unobserve(entry.target)})},{rootMargin:"50px"});dataMap.forEach(element=>{observer.observe(element)});const slickInvestment=document.querySelector(".slick-slider-investment");if(slickInvestment){$(document).ready(function(){$(".slick-slider-investment").slick({dots:false,infinite:false,speed:250,slidesToShow:2,slidesToScroll:1,variableWidth:true,prevArrow:$(".slick-slider-investment-prev"),nextArrow:$(".slick-slider-investment-next"),responsive:[{breakpoint:1200,settings:{slidesToShow:1,slidesToScroll:1,centerMode:true,infinite:true}}]});AOS.refresh()})}const slickAsset=document.querySelector(".slick-slider-asset");if(slickAsset){$(document).ready(function(){$(".slick-slider-asset").slick({dots:false,infinite:true,speed:250,slidesToShow:3,slidesToScroll:1,prevArrow:$(".slick-slider-asset-prev"),nextArrow:$(".slick-slider-asset-next"),responsive:[{breakpoint:1200,settings:{slidesToShow:2,slidesToScroll:1}},{breakpoint:998,settings:{slidesToShow:2,slidesToScroll:1,centerMode:true}},{breakpoint:768,settings:{slidesToShow:1,slidesToScroll:1,centerMode:true}}]});AOS.refresh()})}const slickRecommendation=document.querySelector(".slick-slider-recommendation");if(slickRecommendation){$(document).ready(function(){$(".slick-slider-recommendation").slick({dots:false,infinite:false,speed:250,slidesToShow:2,slidesToScroll:1,prevArrow:false,nextArrow:false,responsive:[{breakpoint:1200,settings:{slidesToShow:1,slidesToScroll:1,centerMode:true,infinite:true}},{breakpoint:460,settings:{slidesToShow:1,slidesToScroll:1,centerMode:true,centerPadding:"15px",infinite:true}}]});AOS.refresh()})}const slickInvestment2=document.querySelector(".slick-slider-investment2");if(slickInvestment2){$(document).ready(function(){$(".slick-slider-investment2").slick({dots:false,infinite:false,speed:250,slidesToShow:2,slidesToScroll:1,variableWidth:true,prevArrow:$(".slick-slider-investment-prev2"),nextArrow:$(".slick-slider-investment-next2"),responsive:[{breakpoint:1200,settings:{slidesToShow:1,slidesToScroll:1,centerMode:true,infinite:true}}]});AOS.refresh()})}const slickApartments=document.querySelector(".slick-slider-apartments");if(slickApartments){$(document).ready(function(){$(".slick-slider-apartments").slick({dots:false,infinite:false,speed:250,slidesToShow:2,slidesToScroll:1,prevArrow:$(".slick-slider-apartments-prev"),nextArrow:$(".slick-slider-apartments-next"),responsive:[{breakpoint:992,settings:{slidesToShow:1,slidesToScroll:1,variableWidth:true,centerMode:true,infinite:true}},{breakpoint:450,settings:{slidesToShow:1,slidesToScroll:1,variableWidth:true,centerMode:true,infinite:true,centerPadding:"15px"}}]});AOS.refresh()})}class Counter{constructor(element,targetValue,duration=2e3){this.element=element;this.targetValue=targetValue;this.duration=duration;this.startValue=0;this.startTime=null}animate=currentTime=>{if(!this.startTime)this.startTime=currentTime;const progress=currentTime-this.startTime;const value=Math.min(this.startValue+progress/this.duration*this.targetValue,this.targetValue);this.element.textContent=Math.floor(value);if(value<this.targetValue){requestAnimationFrame(this.animate)}};start(){requestAnimationFrame(this.animate)}}const numbersArr=document.querySelectorAll("[data-number]");if(numbersArr.length>0){const observerNumber=new IntersectionObserver(entries=>{entries.forEach(entry=>{if(entry.isIntersecting){const numberPattern=/\d+/g;let number=entry.target.dataset.number;let reg=number.match(numberPattern);const counter=new Counter(entry.target,reg[0]);counter.start();observerNumber.unobserve(entry.target)}})},{rootMargin:"50px"});numbersArr.forEach(element=>{observerNumber.observe(element)})}const chBoxes=document.querySelectorAll('.dropdown-menu input[type="checkbox"]');const dpBtn=document.getElementById("multiSelectDropdown");let mySelectedListItems=[];function handleCB(){mySelectedListItems=[];let mySelectedListItemsText="";chBoxes.forEach(checkbox=>{if(checkbox.checked){mySelectedListItems.push(checkbox.value);mySelectedListItemsText+=checkbox.value+", "}});dpBtn.innerText=mySelectedListItems.length>0?mySelectedListItemsText.slice(0,-2):"Udogodnienia"}if(chBoxes&&dpBtn){chBoxes.forEach(checkbox=>{checkbox.addEventListener("change",handleCB)})}document.addEventListener("DOMContentLoaded",()=>{document.querySelectorAll("p").forEach(function(p){p.innerHTML=p.innerHTML.replace(/ (\w) /g," $1&nbsp;")})});const mainAxis=document.querySelector("#main-ap-axis");const buttons=document.querySelector(".row-grid-btns");if(mainAxis){const rows=mainAxis.querySelectorAll("[data-axis='row']");const rowBtn=buttons.querySelector(".row-btn");const gridBtn=buttons.querySelector(".grid-btn");const setActiveButton=activeButton=>{rowBtn.classList.toggle("active",activeButton===rowBtn);gridBtn.classList.toggle("active",activeButton===gridBtn)};gridBtn.addEventListener("click",()=>{rows.forEach(row=>{row.classList.add("main-ap-box-grid")});setActiveButton(gridBtn)});rowBtn.addEventListener("click",()=>{rows.forEach(row=>{row.classList.remove("main-ap-box-grid")});setActiveButton(rowBtn)})}